import React, { Component } from 'react';

class ConferenceForm extends Component {
  constructor(props) {
    super(props);
    this.state = {
      apellidos: '',
      pais: '',
      afiliacion: '',
      correo: '',
      telefono: '',
      tipoParticipacion: 'Autor',
      esMiembroIEEE: false,
      numeroMembresia: ''
    };
  }

  handleInputChange = (event) => {
    const { name, value } = event.target;
    this.setState({ [name]: value });
  }

  handleSubmit = (event) => {
    event.preventDefault();
    // Aquí puedes enviar los datos al servidor o realizar las acciones necesarias
    console.log(this.state);
  }

  render() {
    return (
      <div>
        <h1>IEEEC3 CONFERENCE</h1>
        <form onSubmit={this.handleSubmit}>
          <label>
            Apellidos:
            <input
              type="text"
              name="apellidos"
              value={this.state.apellidos}
              onChange={this.handleInputChange}
              required
            />
          </label>
          <br />

          <label>
            País:
            <input
              type="text"
              name="pais"
              value={this.state.pais}
              onChange={this.handleInputChange}
              required
            />
          </label>
          <br />

          <label>
            Afiliación:
            <input
              type="text"
              name="afiliacion"
              value={this.state.afiliacion}
              onChange={this.handleInputChange}
              required
            />
          </label>
          <br />

          <label>
            Correo electrónico:
            <input
              type="email"
              name="correo"
              value={this.state.correo}
              onChange={this.handleInputChange}
              required
            />
          </label>
          <br />

          <label>
            Teléfono:
            <input
              type="tel"
              name="telefono"
              value={this.state.telefono}
              onChange={this.handleInputChange}
              required
            />
          </label>
          <br />

          <label>
            Estudiante o Profesional:
            <select
              name="tipoParticipacion"
              value={this.state.tipoParticipacion}
              onChange={this.handleInputChange}
            >
              <option value="Estudiante">Estudiante</option>
              <option value="Profesional">Profesional</option>
            </select>
          </label>
          <br />

          <label>
            Miembro IEEE:
            <input
              type="checkbox"
              name="esMiembroIEEE"
              checked={this.state.esMiembroIEEE}
              onChange={this.handleInputChange}
            />
          </label>
          <br />

          {this.state.esMiembroIEEE && (
            <label>
              Número de Membresía IEEE:
              <input
                type="text"
                name="numeroMembresia"
                value={this.state.numeroMembresia}
                onChange={this.handleInputChange}
              />
            </label>
          )}
          <br />

          <label>
            Tipo de participación:
            <input
              type="radio"
              name="tipoParticipacion"
              value="Autor"
              checked={this.state.tipoParticipacion === 'Autor'}
              onChange={this.handleInputChange}
            />
            Autor
            <input
              type="radio"
              name="tipoParticipacion"
              value="Asistente"
              checked={this.state.tipoParticipacion === 'Asistente'}
              onChange={this.handleInputChange}
            />
            Asistente
          </label>
          <br />

          <button type="submit">Confirmar</button>
        </form>
      </div>
    );
  }
}

export default ConferenceForm;
